(4, 'A WORLD OF FINER TASTE AND LGANTE', '<p>Affluence is embedded in every inch of Central 50, located at Noida Sector 50. It consists of world-class brands along with<br>cafes, restaurants, and entertainment zones echoing grandeur. Experience indulgence coursing through your blood here with<br>the taste of pure extravaganza.<br></p>', '', 0, 0, '2023-09-22', 1695371286, '103.76.139.176', '', '2023-09-22', 1695371286, 2, 1, 'A-WORLD-OF-FINER-TASTE-AND-C389LC389GANTE-CENTRAL-50', '', 'manage_home_sec'),
(5, 'Unfold an eloquent Highstreet experience', '<p>entral 50 is crafted with customized design and layouts<br>to highlight your retail experience with the utmost clarity<br>and impeccable visibility for your brand. Unraveling an<br>enhanced experience with composed exploration for<br>visitors that meet their desire for a simple and sorted<br>shopping experience<br></p>', '', 23, 0, '2023-09-22', 1695371406, '103.76.139.176', '', '2023-09-22', 1695371406, 2, 1, 'Unfold-an-eloquent-Highstreet-experience', '', 'manage_home_sec'),
